import React, { useEffect, useState } from 'react';

const Challenge = () =>{
    
    let [count, setcount] = useState(0);
    useEffect(() =>{
        alert('Hii')
    });
    const Inc = () =>{
        setcount(count + 1);
    }
     return <button onClick={Inc} className="btn btn-danger ">Click ME {count}</button>
}

export default Challenge;
